--TABLE CART
DECLARE 

    i NUMBER := 10000;
    
    member_id NUMBER(20);
    product_id NUMBER(20);
    quantity NUMBER(20);
    
CURSOR cur IS SELECT m.member_id, 
                     p.product_id, 
                     quantity 
              FROM Transactions t
                   INNER JOIN Member m ON t.member_id = m.member_id
                   INNER JOIN Product p ON t.product_id = p.product_id
                   AND t.approvalstatus = 'APPROVED';
  BEGIN
     OPEN cur;
        LOOP FETCH cur INTO member_id, product_id, quantity;
     EXIT WHEN cur%NOTFOUND;
           i := i + 1;
        END LOOP;  
END;
